import React from 'react';
import styled from 'styled-components';
import './App.css';

const HomePage = styled.div`
  display: flex;
  flex-direction: column;
  min-height: 100vh; /* Ensures the page takes at least full viewport height */
`;

const Header = styled.header`
  width: 100%;
  height: 80px;
  position: fixed;
  background: var(--color-white);
  z-index: 1000;
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding: 0 20px;
`;

const Logo = styled.img`
  height: 60px;
  width: 60px;
  object-fit: cover;
`;

const Nav = styled.nav`
  display: flex;
  align-items: center;
  gap: var(--gap-xl);
`;

const NavItem = styled.a`
  text-decoration: none;
  color: var(--color-black);
  font-size: var(--font-size-base);
  font-family: var(--font-changa-one);
  font-weight: 400;
`;

const Button = styled.button`
  cursor: pointer;
  border: none;
  padding: var(--padding-sm) var(--padding-base);
  background: ${({ primary }) => primary
    ? 'linear-gradient(90deg, #1A2B51 0%, #EC8845 100%)'
    : 'var(--color-black)'
  };
  border-radius: var(--br-7xs);
  color: var(--color-white);
  font-size: var(--font-size-base);
  font-family: var(--font-khula);
  display: flex;
  align-items: center;
  justify-content: center;
`;

const HeroSection = styled.section`
  width: 100%;
  height: 200px;
  position: relative;
  margin-top: 80px; /* Adjusted margin-top */
`;

const HeroImage = styled.img`
  width: 100%;
  height: 200px;
  object-fit: cover;
`;

const HeroOverlay = styled.div`
  position: absolute;
  top: 0;
  width: 100%;
  height: 100%;
  background: rgba(26, 43, 81, 0.55);
`;

const HeroTitle = styled.h1`
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  color: var(--color-white);
  font-size: 50px;
  font-family: var(--font-changa-one);
  font-weight: 400;
  text-align: center;
`;

const Section = styled.section`
  display: flex;
  align-items: flex-start;
  justify-content: flex-start;
  padding: var(--padding-base) var(--padding-sm);
`;

const ExploreColleges = styled.div`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  justify-content: flex-start;
`;

const Title = styled.h1`
  margin: 0;
  font-size: 2.5rem;
  font-family: var(--font-changa-one);
  flex-shrink: 0;
`;

const ProductImage = styled.img`
  loading: lazy;
  width: 100%;
`;

const ProductInfo = styled.div`
  display: flex;
  flex-direction: column;
  gap: var(--gap-xl);
`;

const ProductCard = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  margin: var(--gap-xl);
`;

const SearchSection = styled.section`
  display: flex;
  align-items: center;
  justify-content: center;
  padding: var(--padding-base) 0;
`;

const SearchInput = styled.input`
  padding: var(--padding-sm);
  width: 100%;
  max-width: 500px;
  border: 1px solid var(--color-gray-100);
  border-radius: var(--br-7xs);
`;

const TestimonialsSection = styled.section`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  justify-content: flex-start;
  padding: var(--padding-base);
`;

const Testimonial = styled.div`
  display: flex;
  align-items: center;
  margin-bottom: var(--padding-base);
`;

const Avatar = styled.img`
  loading: lazy;
  width: 50px;
  height: 50px;
  border-radius: 50%;
  margin-right: var(--gap-xl);
`;

const TestimonialText = styled.div`
  display: flex;
  flex-direction: column;
`;

const TestimonialName = styled.span`
  font-weight: bold;
`;

const TestimonialCourse = styled.span`
  color: var(--color-gray-100);
`;

const Footer = styled.footer`
  width: 100%;
  background: #121826;
  color: #D3D3D3;
  position: relative;
  padding: 40px 0;
  display: flex;
  justify-content: space-around;
  flex-wrap: wrap;
  box-sizing: border-box;
`;

const FooterSection = styled.div`
  display: flex;
  flex-direction: column;
  margin: 0 10px;
`;

const FooterHeader = styled.div`
  text-align: center;
  color: #F5970B;
  font-size: 15px;
  font-family: 'Open Sans', sans-serif;
  font-weight: 600;
`;

const Divider = styled.div`
  width: 179px;
  height: 24px;
  transform: rotate(-180deg);
  text-align: center;
  color: #D6D2D2;
  font-size: 17px;
  font-family: 'Open Sans', sans-serif;
  font-weight: 400;
`;

const FooterLink = styled.div`
  color: #ADADAD;
  font-size: 13px;
  font-family: 'Open Sans', sans-serif;
  font-weight: 600;
  margin-bottom: 8px;
`;

const SocialMediaIcons = styled.div`
  display: flex;
  justify-content: space-around;
  align-items: center;
  width: 50%;
  margin: 10px 0;
`;

const SocialIcon = styled.img`
  width: 20px;
  height: 20px;
`;

function App() {
  return (
    <HomePage>
      <Header>
        <Logo src="https://via.placeholder.com/60x60" alt="Logo" />
        <Nav>
          <NavItem href="#">Home</NavItem>
          <NavItem href="#">Spot round admission</NavItem>
          <NavItem href="#">College Predictor</NavItem>
          <NavItem href="#">Resources</NavItem>
          <NavItem href="#">Contact Us</NavItem>
        </Nav>
        <div style={{ display: 'flex', gap: '10px' }}>
          <Button primary>
            <span>Sign Up</span>
          </Button>
          <Button>
            <span>Login</span>
          </Button>
        </div>
      </Header>

      <Section>
        <ExploreColleges>
          <Title>
            Explore 1000+ colleges and universities
            <br />
            and choose what’s best
            <br />
            for YOU
          </Title>
          <ProductImage src="https://via.placeholder.com/800x400" alt="Colleges" />
        </ExploreColleges>
        <ProductInfo>
          <Button primary>
            <span>Get Started</span>
          </Button>
          <Button>
            <span>Explore Colleges</span>
          </Button>
        </ProductInfo>
      </Section>
      <Section>
        <Title>Explore products</Title>
        <ProductCard>
          <ProductImage src="https://via.placeholder.com/300x200" alt="Product 1" />
          <Title>SPOT ROUND ADMISSION</Title>
          <p>Info about what the product does</p>
          <Button primary>
            <span>EXPLORE</span>
          </Button>
        </ProductCard>
        <ProductCard>
          <ProductImage src="https://via.placeholder.com/300x200" alt="Product 2" />
          <Title>COLLEGE PREDICTOR</Title>
          <p>Info about what the product does</p>
          <Button primary>
            <span>EXPLORE</span>
          </Button>
        </ProductCard>
        <ProductCard>
          <ProductImage src="https://via.placeholder.com/300x200" alt="Product 3" />
          <Title>SPOT ROUND ADMISSION</Title>
          <p>Info about what the product does</p>
          <Button primary>
            <span>EXPLORE</span>
          </Button>
        </ProductCard>
      </Section>
      <ProductImage src="https://via.placeholder.com/1280x400" alt="Banner" />
      <SearchSection>
        <SearchInput placeholder="search for colleges, courses and more..." />
      </SearchSection>
      <TestimonialsSection>
        <Title>Words of Gratitude</Title>
        <Testimonial>
          <Avatar src="https://via.placeholder.com/50" alt="Avatar" />
          <TestimonialText>
            <TestimonialName>Jane Doe</TestimonialName>
            <TestimonialCourse>Engineering Student</TestimonialCourse>
            <p>Thank you for the amazing support throughout my admission process!</p>
          </TestimonialText>
        </Testimonial>
        {/* Add more testimonials as needed */}
      </TestimonialsSection>
      <Footer>
        {/* Quick Links */}
        <FooterSection>
          <FooterHeader>
            QUICK <span style={{ color: '#F5970B' }}>LINKS</span>
          </FooterHeader>
          <Divider>-----------------------------</Divider>
          <FooterLink>Universities</FooterLink>
          <FooterLink>Colleges</FooterLink>
          <FooterLink>Courses</FooterLink>
          <FooterLink>Entrance Exams</FooterLink>
          <FooterLink>Rank Predictor</FooterLink>
          <FooterLink>Gallery</FooterLink>
          <FooterLink>Mock Exams</FooterLink>
        </FooterSection>

        {/* Useful URLs */}
        <FooterSection>
          <FooterHeader>
            USEFUL <span style={{ color: '#F5970B' }}>URLS</span>
          </FooterHeader>
          <Divider>-----------------------------</Divider>
          <FooterLink>Careers</FooterLink>
          <FooterLink>Exam Schedule</FooterLink>
          <FooterLink>Exam Results</FooterLink>
          <FooterLink>Interview Tips</FooterLink>
          <FooterLink>Sample Papers</FooterLink>
          <FooterLink>Application Forms</FooterLink>
          <FooterLink>Resume Tips</FooterLink>
        </FooterSection>

        {/* Contact Us */}
        <FooterSection>
          <FooterHeader>
            CONTACT <span style={{ color: '#F5970B' }}>US</span>
          </FooterHeader>
          <Divider>-----------------------------</Divider>
          <div style={{ textAlign: 'center', color: '#D3D3D3', fontSize: '13px', fontFamily: 'Open Sans', fontWeight: '400' }}>
            VidyarthiMitra Office
          </div>
          <div style={{ width: '350px', height: '76px', textAlign: 'center', color: '#ADADAD', fontSize: '13px', fontFamily: 'Open Sans', fontWeight: '600' }}>
            Address: 16/3/3A/1, 1st Floor, Hari Krupa Complex, Above Ghate Hospital, Karvenagar-Paud Road, Pune-411038<br />
            Tel: 020-25440601<br />
            WhatsApp: 7720082071<br />
            Email: info@vidyarthimitra.org
          </div>
        </FooterSection>

        {/* Social Media */}
        <FooterSection>
          <FooterHeader>
            FOLLOW <span style={{ color: '#F5970B' }}>US</span>
          </FooterHeader>
          <Divider>-----------------------------</Divider>
          <div style={{ width: '191px', height: '25px', textAlign: 'center', color: '#ADADAD', fontSize: '13px', fontFamily: 'Open Sans', fontWeight: '600' }}>
            Stay connected on social media for the latest updates
          </div>
          <SocialMediaIcons>
            <SocialIcon src="https://via.placeholder.com/20" alt="Social 1" />
            <SocialIcon src="https://via.placeholder.com/20" alt="Social 2" />
            <SocialIcon src="https://via.placeholder.com/20" alt="Social 3" />
            <SocialIcon src="https://via.placeholder.com/20" alt="Social 4" />
            <SocialIcon src="https://via.placeholder.com/20" alt="Social 5" />
          </SocialMediaIcons>
        </FooterSection>
      </Footer>
    </HomePage>
  );
}

export default App;
